import React, { useEffect, useState } from "react";
import { getFormulaire } from "../services/ApiService";

export default function FormulaireList() {
    const [formulaires, setFormulaires] = useState([]);

    useEffect(() => {
        let isMounted = true;

        getFormulaire()
            .then(res => {
                // Check if the component is still mounted
                if (isMounted) {
                    console.log("res from Api ", res);
                    setFormulaires(res);
                }
            })
            .catch(error => {
                console.error("Error fetching formulaires:", error);
            });

        // Cleanup function to handle component unmounting
        return () => {
            isMounted = false;
        };
    }, []);

    return (
        <>
            <h3>Formulaire</h3>
            <table>
                <thead>
                    <tr>
                        <th>Nom</th>
                        <th>Pr√©nom</th>
                        <th>Email</th>
                    </tr>
                </thead>
                <tbody>
                    {formulaires.map(formulaire => (
                        <tr key={formulaire.formulaire_id}>
                            <td>{formulaire.nom}</td>
                            <td>{formulaire.prenom}</td>
                            <td>{formulaire.mail}</td>
                            <td><button type="submit">Envoyer</button> </td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </>
    );
}
